            animationDuration: (anim.duration || 1) + 's',
            animationDelay: (anim.delay || 0) + 's',
            animationIterationCount: anim.iterationCount || 1,
            animationTimingFunction: anim.timingFunction || 'ease',
            animationFillMode: 'both'
